import "./Stations.css";
import StationIcon from "../StationIcon/StationIcon";
import { useEffect, useState } from "react";

const Stations = () => {
  const [data, setData] = useState(null);

  const getData = async () => {
    const response = await fecth("/data/stations.json");
    const data = await response.json();
    setData(data);
  };

  useEffect(() => getData(), []);

  if (data === null) {
    return (
      <ul className="stations-list">
        <li>
          <StationIcon /><span className="station-name"></span>
          loading...
        </li>
        <li>
          <StationIcon /><span className="station-name"></span>
          loading...
        </li>
        <li>
          <StationIcon /><span className="station-name"></span>
          loading...
        </li>
        <li>
          <StationIcon /><span className="station-name"></span>
          loading...
        </li>
        <li>
          <StationIcon /><span className="station-name"></span>
          loading...
        </li>
      </ul>
    );
  }
  return (
    <div>
      <ul className="stations-list">
        {Object.keys(data)
          .map((id) => ({
            id,
            name: data[id],
          }))
          .map(({ id, name }) => (
            <li key={id}>
              <StationIcon /><span className="station-name"></span>
              {name}
            </li>
          ))}
      </ul>
    </div>
  );
};

export default Stations;
